import React from "react";

const Rank =({user})=>{
    let Name=user.name;
    Name.uppercase()
    return (
    

    <div>
        <div className="white f3">
            {`${user.name},YOUR CURRENT RANK IS:`}
        </div>
        <div className="white f2">
            {`#${user.entries}`}
        </div>
    </div>
)
}

export default Rank;
